import React from 'react';
import Navbar from 'react-bootstrap/Navbar';



const HeaderComponent =() => {

    return (
            <Navbar
                bg="dark"
                variant="dark"
                className="mb-4" >
                <Navbar.Brand href="/">
                    Home
                </Navbar.Brand>
            </Navbar>

    )
}

export default HeaderComponent
